} name type description type TransactionType Transaction type. data One of TransactionScript , TransactionCreate , or TransactionMint Transaction data. Transaction is invalid if: type > TransactionType.Create gasLimit > MAX_GAS_PER_TX blockheight() < maturity inputsCount > MAX_INPUTS outputsCount > MAX_OUTPUTS witnessesCount > MAX_WITNESSES No inputs are of type InputType.Coin or InputType.Message More than one output is of type OutputType.Change for any asset ID in the input set Any output is of type OutputType.Change for any asset ID not in the input set More than one input of type InputType.Coin for any Coin ID in the input set More than one input of type InputType.Contract for any Contract ID in the input set More than one input of type InputType.Message for any Message ID in the input set When serializing a transaction, fields are serialized as follows (with inner structs serialized recursively): uint8, uint16, uint32, uint64: big-endian right-aligned to 8 bytes. byte[32]: as-is. byte[]: as-is, with padding zeroes aligned to 8 bytes. When deserializing a transaction, the reverse is done. If there are insufficient bytes or too many bytes, the transaction is invalid. TransactionScript enum ReceiptType : uint8 { Call = 0, Return = 1, ReturnData = 2, Panic = 3, Revert = 4, Log = 5, LogData = 6, Transfer = 7, TransferOut = 8, ScriptResult = 9, MessageOut = 10,
