The @indexed directive adds an index to the underlying database column for the indicated field of that type. Generally, an index is a data structure that allows you to quickly locate data without having to search each row in a database table. schema { query: QueryRoot
} type QueryRoot { book: Book library: Library
} type Book { id: ID! name: Bytes8! @indexed
} type Library { id: ID! book: Book!
